        options: {"pointSize": 2, "hAxis": {"viewWindow": {"max": 590, "min": 1}, "viewWindowMode": "explicit", "maxValue": 590, "minValue": 1}, "interpolateNulls": true, "title": "Square fluctuations for Mode 10", "height": 900, "width": 1440, "vAxis": {"viewWindow": {"max": 0.00083436569789985726, "min": 0}, "viewWindowMode": "explicit", "maxValue": 0.00083436569789985726, "minValue": 0}},
        containerId: 'visualization',
        chartType: 'LineChart'
      });
      wrapper.draw();
    }

    function openEditor() {
      // Handler for the "Open Editor" button.
      var editor = new google.visualization.ChartEditor();
      google.visualization.events.addListener(editor, 'ok',
        function() {
          wrapper = editor.getChartWrapper();
          wrapper.draw(document.getElementById('visualization'));
      });
      editor.openDialog(wrapper);
    }

    // Set a callback to run when the Google Visualization API is loaded.
    google.setOnLoadCallback(init);

    </script>
  </head>
  <body style="font-family: Arial;border: 0 none;">
    <input type='button' onclick='openEditor()' value='Customize Plot'>
    <div id='visualization'></div>
  </body>
</html>
